import "../styles/home.css";

export default function SocialMedia(props) {
	return (
		<div className="socialMedia">
			<a
				href="https://www.linkedin.com/in/mouad-ajmani-7b0b7b1b6/"
				target="_blank"
				rel="noreferrer"
			>
                <div className="logo"></div>
                Mouad Ajmani

			</a>
		</div>
	);
}
